def solve(n, m):
    count = 0
    num = 1
    while count < n:
        if num % m != 0:
            count += 1
        if count == n:
            return num
        num += 1

def solve(n, multiple):
    counter = 0
    num = 0
    while counter < n:
        num += 1
        if num % multiple != 0:
            counter += 1
    return num

def solve(n, num):
    count = 0
    i = 1
    while count < n:
        if i % num != 0:
